-- CATEGORY 테이블 생성
CREATE TABLE CATEGORY (
  ca_id SERIAL PRIMARY KEY,
  ca_nm VARCHAR,
  supi_ID INTEGER
);

-- POST 테이블 생성
CREATE TABLE POST (
  POST_ID SERIAL PRIMARY KEY,
  SUBJECT VARCHAR,
  CONTENT TEXT,
  CATEGORY_ID INTEGER REFERENCES CATEGORY(ca_id),
  CREATE_DATE TIMESTAMP,
  UPDATE_DATE TIMESTAMP
);

